window.bookSummaryJSON = "<p>Claire Andrews spends her entire life desperately trying to save her little brother from the demons of their past.</p> <p>After he takes his own life, she knows the only way she can survive the pain is to get far away from their hometown.</p> <p>When her boss offers her the opportunity to start fresh in another state, she jumps at the chance. Not realizing she's heading straight into the path of a man who has sworn off love.</p> <p>Tyler Henry is a cowboy who refuses to make time for anything except his ranch and paralyzed younger brother, Luke.</p> <p>When Claire crash lands in front of him, he shoves aside his feelings. Promising himself he will stay away. The mistakes from his past convincing him he is unworthy of anything more.</p> <p>But when fate keeps throwing them together, he questions everything he thought he knew about the man he's become.</p>"; 
